import React from 'react';
import {
  Collapse,
  Container,
  List,
  ListItem,
  ListItemText,
  Paper,
  Typography
} from '@material-ui/core';
// import {
//   ExpandLess,
//   ExpandMore
// } from '@material-ui/icons';

import { employeeData, countEmployees, countDevices } from '../data';

export default function Content(){
  const [open, setOpen] = React.useState(true);
  console.log(open);
  const handleClick = () =>{
    setOpen(false);
  };
  return(
    <Container>
      <Typography>Summary</Typography>
      <Paper>
        <Typography>Employees Enrolled: {countEmployees(employeeData)}</Typography>
        <Typography>Devices Activated: {countDevices(employeeData)}</Typography>
      </Paper>
      <Typography>Details</Typography>
      <Paper>
        <List>
        {employeeData.map((employee, index) =>
          <>
            <ListItem button onClick={handleClick} key={index}>
              <ListItemText primary={employee.first_name}/>
              {open ? <p>Less</p> : <p>More</p>}
            </ListItem>
            <Collapse in={open}>
              <List>
                <ListItem key={index}>
                  <ListItemText primary="Device"/>
                </ListItem>
              </List>
            </Collapse>
          </>
        )}
        </List>
      </Paper>
    </Container>
  );
};
